class Solution {
  int stringCount(int n) {
    const int mod = 1000000007;
    if (n < 4) return 0;
    int total = 1, extraLetters = n - 4;
    for (int i = 1; i <= n; i++) total = (total * 26) % mod;
    for (int i = 1; i <= 4; i++) total = (total - comb(extraLetters + i, i, mod)) % mod;
    if (total < 0) total += mod;
    return total;
  }

  int comb(int n, int k, int mod) {
    if (k > n) return 0;
    int result = 1;
    for (int i = 1; i <= k; i++) {
      result = (result * (n - k + i)) % mod;
      result = (result * modInverse(i, mod)) % mod;
    }
    return result;
  }

  int modInverse(int a, int mod) {
    int m0 = mod, t, q;
    int x0 = 0, x1 = 1;
    if (mod == 1) return 0;
    while (a > 1) {
      q = a ~/ mod;
      t = mod;
      mod = a % mod;
      a = t;
      t = x0;
      x0 = x1 - q * x0;
      x1 = t;
    }
    if (x1 < 0) x1 += m0;
    return x1;
  }
}
